import React from "react";
import { motion, useViewportScroll, useTransform } from "framer-motion";
import { images } from "../../constants";

import "./Shapes.scss";

const Shapes = () => {
  const { scrollY } = useViewportScroll();
  const y1 = useTransform(scrollY, [0, 300], [0, 200]);
  const y2 = useTransform(scrollY, [0, 300], [0, -50]);

  return (
    <motion.div className="app__shapes-container">
      <motion.div style={{ y: y1 }}>
        {/* <i className="fa-brands fa-react fa-5x"></i> */}
        <img src={images.mountainTwo} alt="mountain" />
      </motion.div>
      <motion.div style={{ y: y2 }}>
        {/* <i className="fa-brands fa-react fa-5x" style={{ color: "red" }}></i> */}
        <img src={images.mountain} alt="mountain" />
      </motion.div>
    </motion.div>
  );
};

export default Shapes;
